import Button from 'react-bootstrap/Button';
import { useNavigate } from 'react-router-dom';

const Create = () => {
    const navigate = useNavigate();
    
   const handleNavigate = () => {
    navigate('-1')
   }

    return (
       <div>  
         <h1>CREATE</h1>
         <Button onClick={handleNavigate}>BACK</Button>
        </div>
     );
}
 
export default Create;
